    public String insertDatasToDb(String db_name) {

        TetDebugUtil.e(pseudo_tag, "Make insertDatasToDb");
        ShowlongLargeString.showString(query);
        StringTokenizer st = new StringTokenizer(query, "\n");
        int t = st.countTokens();
        TetDebugUtil.e(pseudo_tag, "count tockens = " + t);
        AllDatabaseController allDbController = AllDatabaseController.getSingleControllerInstance();
        for (int i = 0; i < t; i++) {
            String sql = st.nextToken();
            TetDebugUtil.e(pseudo_tag, sql);
            allDbController.executeQuery(ThisApp.getContextApp(), db_name, sql);
        }

        return "OK";
    }

